import logo from './logo.svg';
import './App.css';

let displaying = {
  display: "none"
}

function showImg() {
  displaying.display = "flex"
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" onClick={() => showImg()} />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <img src='https://i.imgur.com/svtJbZs.jpg' alt='bkImg' style={{displaying}}></img>
      </header>
    </div>
  );
}

export default App;
